  return (
    <div className="navlinks-container" >


        <Link classNameto= "/">HOME</Link>

        <Link to= "/portfolio">PORTFOLIO</Link>

        <Link to= "/contact-me">CONTACT ME</Link> 


    </div>
  )
}
